  input: 'TEXT,F3A,,"The Raj for Congress procedures for obtaining required contributor
    information are as follows: (1) Our solicitations for contributions contain a
    clear and conspicuous request for the required information and the solicitations
    inform the contributor that this information is required to be reported under
    federal law, (2) at the time of receipt of a contribution, a campaign staff member
    reviews each contribution and attempts to gather the required information at the
    time of receipt by telephone or email, (3) a follow up letter is sent within 30
    days of receipt if the required information has not been obtained, and (4) the
    campaign will either file amended reports, or will report memo entries on the
    next report due if it receives the information after the filing of a previous
    report."'
